import React from 'react';
import ChooseFactionButton from '../components/ChooseFactionButton';
import factions from '../data/factions.json';
import { Box } from '@mui/material'



function Home() {
  let i = -1;

  return (
    <Box sx={{
      display: 'flex',
      justifyContent: 'center',
      alignContent: 'center',
      maxWidth: '80%',
      flexWrap: 'wrap'
    }}>
    {
      factions.map((faction) => {
        i++;
        return(<ChooseFactionButton fullname={faction.fullname} logo={faction.logo} key={i}/>);
      })
    }
    </Box>
  );
}

export default Home
